function plug_area_data(val) {
	var data = [{"id":"0","area":"\u8bf7\u9009\u62e9","pid":"0"}];
	for(var one=0; one < area_data.length; one++) {
		if(area_data[one]['pid'] == val) {
			data[data.length] = area_data[one];
		}
	}
	return data;
}

function plug_area_start(name, val) {
	if(val) {
		var province = val.substr(0, 2)+'0000';
		var area_data = plug_area_data(0);
		// console.log(area_data);
		var area_string = '<select class="normal_select" id="'+name+'_province" name="'+name+'_province" onchange="plug_area_onchange(this)">';
		
		for(var one=0; one < area_data.length; one++) {
			area_string += '<option value="'+area_data[one]['id']+'" ';
			if(province == area_data[one]['id']) {
				area_string += 'selected';
			}
			area_string += ' > '+area_data[one]['area']+'</option>';
		}
		area_string += '</select>';
		
		var area_data = plug_area_data(province);
		var city = val.substr(0, 4)+'00';
		area_string += '<select class="normal_select" id="'+name+'_city" name="'+name+'_city" onchange="plug_area_onchange(this)">';
		for(var one=0; one < area_data.length; one++) {
			area_string += '<option value="'+area_data[one]['id']+'" ';
			if(city == area_data[one]['id']) {
				area_string += 'selected';
			}
			area_string += ' > '+area_data[one]['area']+'</option>';
		}
		area_string += '</select>';
		
		var area_data = plug_area_data(city);
		var district = val;
		area_string += '<select class="normal_select" id="'+name+'_district" name="'+name+'_district" onchange="plug_area_onchange_last(this)">';
		for(var one=0; one < area_data.length; one++) {
			area_string += '<option value="'+area_data[one]['id']+'" ';
			if(district == area_data[one]['id']) {
				area_string += 'selected';
			}
			area_string += ' > '+area_data[one]['area']+'</option>';
		}
		area_string += '</select>';
		
		$('#'+name).html(area_string);
	} else {
		var area_data = plug_area_data(0);
		var area_string = '<select class="normal_select" id="'+name+'_province" name="'+name+'_province" onchange="plug_area_onchange(this)">';
		for(var one=0; one < area_data.length; one++) {
			area_string += '<option value="'+area_data[one]['id']+'">'+area_data[one]['area']+'</option>';
		}
		area_string += '</select>';
		area_string += '<select class="normal_select" id="'+name+'_city" name="'+name+'_city" onchange="plug_area_onchange(this)"><option value="0">请选择</option></select>';
		area_string += '<select class="normal_select" id="'+name+'_district" name="'+name+'_district" onchange="plug_area_onchange_last(this)"><option value="0">请选择</option></select>';
		$('#'+name).html(area_string);
	}
}

