function plug_area_onchange(obj) {
	var type = obj.name.split('_');
	var area_data = plug_area_data(obj.value);				
	if(type[1] == 'province') {
		$("select[name='"+type[0]+"_city']").empty();
		if(obj.value == 0) {
			$("select[name='"+type[0]+"_city']").append("<option value='0'>请选择</option>");
		} else {
			for(var one=0; one < area_data.length; one++) {
				$("select[name='"+type[0]+"_city']").append("<option value='"+area_data[one]['id']+"'>"+area_data[one]['area']+"</option>");
			}
		}
		$("select[name='"+type[0]+"_district']").empty();
		$("select[name='"+type[0]+"_district']").append("<option value='0'>请选择</option>");
	} else if(type[1] == 'city') {
		$("select[name='"+type[0]+"_district']").empty();
		if(obj.value == 0) {
			$("select[name='"+type[0]+"_district']").append("<option value='0'>请选择</option>");
		} else {
			for(var one=0; one < area_data.length; one++) {
				$("select[name='"+type[0]+"_district']").append("<option value='"+area_data[one]['id']+"'>"+area_data[one]['area']+"</option>");
			}
		}
	}

	plug_area_onchange_last(obj);
}

function plug_area_onchange_last(obj){
	try{
		if(typeof(eval(update_map)) == "function"){
			update_map();
		}
	}catch(e){

	}
}
function plug_area_name(name, val) {
	if(val) {
		var province = val.substr(0, 2)+'0000';
		var area_data = plug_area_data(0);
		// console.log(area_data);
		var area_string = '';
		
		for(var one=0; one < area_data.length; one++) {
			if(province == area_data[one]['id']) {
				area_string+=  area_data[one]['area'];
			}
		}

		var area_data = plug_area_data(province);
		var city = val.substr(0, 4)+'00';
		for(var one=0; one < area_data.length; one++) {
			if(city == area_data[one]['id']) {
				area_string += area_data[one]['area'];
			}
			
		}
		
		var area_data = plug_area_data(city);
		var district = val;
		for(var one=0; one < area_data.length; one++) {
			if(district == area_data[one]['id']) {
				area_string += area_data[one]['area'];
			}
			
		}
		
		$('#'+name).html(area_string);
	}
}
